import { useEffect, useState } from 'react'

function Content() {
  const [comments, setComments] = useState([])
  const type = ['comments', 'post', 'albums']
  useEffect(() => {
    fetch('https://jsonplaceholder.typicode.com/comments')
      .then(res => res.json())
      .then(data => {
        setComments(data)
      })
    console.log(comments.name)
  }, [])

  return (
    <div>
      {type.map(type => (
        <button> {type} </button>
      ))}

      <ul>
        {comments.map(data => (
          <li>{data.name}</li>
        ))}
      </ul>
    </div>
  )
}

export default Content
